import React from "react";
import todoList from "./practice/todo/todoList";

function App() {
  return (
    <div className="container">
      <todoList />
      <input type="text" className="input" />
      <button className="btn">Add todo</button>
      <button className="btn">Clear complete</button>
      <div>0 Todo left</div>
    </div>
  );
}

export default App;
